  Tracklines of the Puerto Rico Trench U.S. Geological Survey Cruise 02051 (National
  Oceanic and Atmospheric Administration 0208) September 24 to September 30, 2002
  (nav2002.shp, polyline shapefile, geographic, WGS84)\",\n\t\"tracking_summary\":
